import { useState } from 'react';

export function ProductsList({ shop }) {
  const { products, setProducts } = useState([]);

  return (
    <div>
      <h2>{shop}</h2>
      <ul>
        {products.map(product => (
          <li></li>
        ))}
        <li>Product 1</li>
        <li>Product 2</li>
        <li>Product 3</li>
      </ul>
    </div>
  );
}
